package org.springframework.samples.petclinic.vet;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import java.time.LocalDate;
import static org.junit.jupiter.api.Assertions.*;

class VetTest {

	private Vet instance;

	@BeforeEach
	void setUp() {
		instance = new Vet();
	}

	@Test
	@DisplayName("Verifies that getSpecialtiesInternal returns an empty HashSet when specialties is initially null")
	void testGetSpecialtiesInternalReturnsEmptySetWhenInitiallyNull() {
		var result = instance.getSpecialtiesInternal();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that getSpecialtiesInternal returns the same Set instance on multiple calls and after adding a specialty")
	void testGetSpecialtiesInternalReturnsSameInstanceOnRepeatedCalls() {
		var result = instance.getSpecialtiesInternal();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that after adding a specialty, getSpecialtiesInternal contains the added specialty")
	void testGetSpecialtiesInternalAfterAddingSpecialty() {
		var result = instance.getSpecialtiesInternal();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verify that getSpecialties returns a list of specialties sorted by name")
	void testGetSpecialtiesReturnsSortedList() {
		var result = instance.getSpecialties();
		assertEquals(null, result);
	}

	@Test
	@DisplayName("Verify that getSpecialties returns an empty list when no specialties are added")
	void testGetSpecialtiesReturnsEmptyListWhenNoSpecialties() {
		var result = instance.getSpecialties();
		assertEquals(null, result);
	}

	@Test
	@DisplayName("Verify that getSpecialties throws NullPointerException when a specialty has a null name during sorting")
	void testGetSpecialtiesThrowsExceptionWithNullName() {
		assertThrows(java.lang.NullPointerException.class, () -> {
			instance.getSpecialties();
		});
	}

	@Test
	@DisplayName("Verifies that getNrOfSpecialties returns the correct count when specialties are added to the vet")
	void testGetNrOfSpecialtiesReturnsCountWhenSpecialtiesAdded() {
		var result = instance.getNrOfSpecialties();
		assertEquals(2, result);
	}

	@Test
	@DisplayName("Verifies that getNrOfSpecialties returns zero when no specialties are added")
	void testGetNrOfSpecialtiesReturnsZeroWhenNoSpecialtiesAdded() {
		var result = instance.getNrOfSpecialties();
		assertEquals(0, result);
	}

	@Test
	@DisplayName("Verifies that getNrOfSpecialties correctly counts multiple specialties added")
	void testGetNrOfSpecialtiesAfterAddingMultipleSpecialties() {
		var result = instance.getNrOfSpecialties();
		assertEquals(5, result);
	}

	@Test
	@DisplayName("Verifies that adding a valid Specialty to a Vet object adds it to the internal specialties collection, which can be confirmed by checking if getSpecialties() contains the added specialty.")
	void testAddSpecialtyHappyPath() {
		instance.addSpecialty(new Vet());
	}

	@Test
	@DisplayName("Verifies behavior when adding a null Specialty to a Vet object, expecting a potential NullPointerException if the underlying collection does not allow nulls.")
	void testAddSpecialtyWithNull() {
		assertThrows(NullPointerException.class, () -> {
			instance.addSpecialty(new Vet());
		});
	}

	@Test
	@DisplayName("Verifies that adding multiple Specialty objects to a Vet object accumulates them correctly in the collection without duplicates if the collection is a Set.")
	void testAddSpecialtyMultiple() {
		instance.addSpecialty(new Vet());
	}

}
